        A: Apply <a href="~/link.aspx?_id=AF0021634852455C802076CEBE7F7F7C&amp;_z=z">Diacon<sup>&reg;</sup> IGR <em>PLUS</em></a> to the moving grain stream as a coarse spray to provide a concentration of 0.5 ppm &ndash; 1 ppm of deltamethrin and 1.25 ppm or 2.5 ppm of (S)-methoprene on the grain. Final spray volume with water solutions is 3-5 gallons of liquid per 1,000 bushels of grain. For rough rice, use 10 gallons of water per 1,000 bushels. For more information, consult the product label.
